import { useState } from "react";
import data from "./data";
import "./styles.css";

export default function Accordian(){
    return(
        <div className="wrapper">
            <div className="accordian">
                {
                    data.map((item)=>
                    <div className="item" key={item.id}>
                        <div className="title">
                            <h3>{item.question}</h3>
                            <span>+</span>
                        </div>
                    </div>    
                    )
                }
            </div>
        </div>
    )
}
